package cool.blink.front.template.css;

public final class Base64Backgrounds {

    private final static String fabric1LightFull = TextureParts.fabric1Light_1.toString() + TextureParts.fabric1Light_2.toString() + TextureParts.fabric1Light_3.toString();
    private final static String dotnoiseLightGreyFull = TextureParts.dotnoiseLightGrey_1.toString();

    private enum TextureParts {

        dotnoiseLightGrey_1(""),
        fabric1Light_1(""),
        fabric1Light_2(""),
        fabric1Light_3("");

        private final String texturePart;

        private TextureParts(final String texturePart) {
            this.texturePart = texturePart;
        }

        @Override
        public final String toString() {
            return texturePart;
        }
    }

    public static final String getFabric1LightFull() {
        return fabric1LightFull;
    }

    public static final String getDotnoiseLightGreyFull() {
        return dotnoiseLightGreyFull;
    }

}
